import React, { useEffect, useState } from "react";
import axios from "axios";

const DoctorList = ({ filters }) => {
  const [doctors, setDoctors] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  useEffect(() => {
    console.log("ðŸ”¹ Filters sent to API:", filters); // Log filters before making request
    
    const fetchDoctors = async () => {
      setLoading(true);
      setError("");
  
      try {
        console.log("ðŸ“¡ Sending request to API...");
        console.log(`ðŸ”¹ URL: http://localhost:4000/api/doctors/filter?${encodeURI(new URLSearchParams(filters))}`);

  
        const response = await axios.get("http://localhost:4000/api/doctors/filter", {
          params: filters,
        });
  
        console.log("âœ… API Response:", response.data);
        setDoctors(response.data);
      } catch (err) {
        console.error("ðŸš¨ Error fetching doctors:", err.message);
        setError("Failed to fetch doctors.");
      } finally {
        setLoading(false);
      }
    };
  
    if (filters) {
      fetchDoctors();
    }
  }, [filters]);
  
  
  return (
    <div>
      <h2>Doctor List</h2>

      {loading && <p>Loading doctors...</p>}
      {error && <p style={{ color: "red" }}>{error}</p>}

      {doctors.length > 0 ? (
        <table border="1">
          <thead>
            <tr>
              {Object.keys(doctors[0]).map((key) => (
                <th key={key}>{key.replace(/_/g, " ")}</th> 
              ))}
            </tr>
          </thead>
          <tbody>
            {doctors.map((doctor, index) => (
              <tr key={index}>
                {Object.values(doctor).map((value, i) => (
                  <td key={i}>{value}</td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        !loading && <p>No doctors found.</p>
      )}
    </div>
  );
};

export default DoctorList;
